import React from "react";

const Wrapper = styled.div`
height:68px;
width:100vw;
`;

const Logo=styled.img`
height:100%;
`;

const Banner=props=>{
    return <Wrapper>
        <Logo src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/1280px-Netflix_2015_logo.svg.png"></Logo>
    </Wrapper>;
}

export default Banner;
